Ext.data.JsonP['API_Runtime_Services_FAQ']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>API Runtime Services FAQ</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-50168339\" class=\"content\">\n                        <h1>API Runtime Services FAQ</h1>\n    <p>This document provides references to answer several API Runtime Services frequently asked questions (FAQs).    </p>\n    <p>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_APIRuntimeServicesFAQ-Exceptionsthrownupondeployment\">Exceptions thrown upon deployment</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluYXBwLmpzb3V0c2lkZXN0YXJ0KCltZXRob2Q\">Exception in app.js outside start() method</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluc2lkZWFwcC5qc3N0YXJ0KCltZXRob2Q\">Exception inside app.js start() method</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluYWNvbnRyb2xsZXIsb3V0c2lkZWFmdW5jdGlvbg\">Exception in a controller, outside a function</a>    </p>\n</li></ul></li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_APIRuntimeServicesFAQ-Exceptionsthrownatruntime\">Exceptions thrown at runtime</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_APIRuntimeServicesFAQ-Exceptioninsynchronouscallshandlingrequests\">Exception in synchronous calls handling requests</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluYXN5bmNocm9ub3VzY2FsbGJhY2tzaGFuZGxpbmdyZXF1ZXN0cyhvcmJhY2tncm91bmRqb2JzKQ\">Exception in asynchronous callbacks handling requests (or background jobs)</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_APIRuntimeServicesFAQ-Applicationcrasheswhilehandlingrequests\">Application crashes while handling requests</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_APIRuntimeServicesFAQ-Applicationcrasheswhilerunningbackgroundjobs\">Application crashes while running background jobs</a>    </p>\n</li></ul></li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_APIRuntimeServicesFAQ-Installationerrors\">Installation errors</a>    </p>\n<ul class=\"toc-indentation \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_FAQ-section-src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUVycm9yOkVOT0VOVCxub3N1Y2hmaWxlb3JkaXJlY3Rvcnk\">Error: ENOENT, no such file or directory</a>    </p>\n</li></ul></li></ul>    <div class=\"section section-2 \" id=\"src-50168339_APIRuntimeServicesFAQ-Exceptionsthrownupondeployment\">\n        <h2 class=\"heading \"><span>Exceptions thrown upon deployment</span></h2>\n    <div class=\"section section-3 \" id=\"src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluYXBwLmpzb3V0c2lkZXN0YXJ0KCltZXRob2Q\">\n        <h3 class=\"heading \"><span>Exception in app.js outside start() method</span></h3>\n    <p>See <a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_APIRuntimeServicesTroubleshooting-Exceptioninapp.jsoutsidestart\">Exception in app.js outside start</a>()method for details on this exception.    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluc2lkZWFwcC5qc3N0YXJ0KCltZXRob2Q\">\n        <h3 class=\"heading \"><span>Exception inside app.js start() method</span></h3>\n    <p>See <a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_APIRuntimeServicesTroubleshooting-Exceptioninsideapp.jsstart\">Exception inside app.js start</a>()method for details on this exception.    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluYWNvbnRyb2xsZXIsb3V0c2lkZWFmdW5jdGlvbg\">\n        <h3 class=\"heading \"><span>Exception in a controller, outside a function</span></h3>\n    <p>See <a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_safe-id-QVBJUnVudGltZVNlcnZpY2VzVHJvdWJsZXNob290aW5nLUV4Y2VwdGlvbmluYWNvbnRyb2xsZXIsb3V0c2lkZWFmdW5jdGlvbg\">Exception in a controller, outside a function</a> for details on this exception.    </p>\n    </div>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168339_APIRuntimeServicesFAQ-Exceptionsthrownatruntime\">\n        <h2 class=\"heading \"><span>Exceptions thrown at runtime</span></h2>\n    <div class=\"section section-3 \" id=\"src-50168339_APIRuntimeServicesFAQ-Exceptioninsynchronouscallshandlingrequests\">\n        <h3 class=\"heading \"><span>Exception in synchronous calls handling requests</span></h3>\n    <p>See <a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_APIRuntimeServicesTroubleshooting-Exceptioninsynchronouscallshandlingrequests\">Exception in synchronous calls handling requests</a> for details on this exception.    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUV4Y2VwdGlvbmluYXN5bmNocm9ub3VzY2FsbGJhY2tzaGFuZGxpbmdyZXF1ZXN0cyhvcmJhY2tncm91bmRqb2JzKQ\">\n        <h3 class=\"heading \"><span>Exception in asynchronous callbacks handling requests (or background jobs)</span></h3>\n    <p>See <a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_safe-id-QVBJUnVudGltZVNlcnZpY2VzVHJvdWJsZXNob290aW5nLUV4Y2VwdGlvbmluYXN5bmNocm9ub3VzY2FsbGJhY2tzaGFuZGxpbmdyZXF1ZXN0cyhvcmJhY2tncm91bmRqb2JzKQ\">Exception in asynchronous callbacks handling requests (or background jobs)</a> for details on this exception.    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-50168339_APIRuntimeServicesFAQ-Applicationcrasheswhilehandlingrequests\">\n        <h3 class=\"heading \"><span>Application crashes while handling requests</span></h3>\n    <p>See <a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_APIRuntimeServicesTroubleshooting-Applicationcrasheswhilehandlingrequests\">Application crashes while handling requests</a> for details on this exception.    </p>\n    </div>\n    <div class=\"section section-3 \" id=\"src-50168339_APIRuntimeServicesFAQ-Applicationcrasheswhilerunningbackgroundjobs\">\n        <h3 class=\"heading \"><span>Application crashes while running background jobs</span></h3>\n    <p><a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_APIRuntimeServicesTroubleshooting-Applicationcrasheswhilerunningbackgroundjobs\">Application crashes while running background jobs</a> for details on this exception.    </p>\n    </div>\n    </div>\n    <div class=\"section section-2 \" id=\"src-50168339_APIRuntimeServicesFAQ-Installationerrors\">\n        <h2 class=\"heading \"><span>Installation errors</span></h2>\n    <div class=\"section section-3 \" id=\"src-50168339_safe-id-QVBJUnVudGltZVNlcnZpY2VzRkFRLUVycm9yOkVOT0VOVCxub3N1Y2hmaWxlb3JkaXJlY3Rvcnk\">\n        <h3 class=\"heading \"><span>Error: ENOENT, no such file or directory</span></h3>\n    <p>See <a class=\"document-link \" href=\"#!/guide/API_Runtime_Services_Troubleshooting-section-src-46245598_safe-id-QVBJUnVudGltZVNlcnZpY2VzVHJvdWJsZXNob290aW5nLUVycm9yOkVOT0VOVCxub3N1Y2hmaWxlb3JkaXJlY3Rvcnk\">Error: ENOENT, no such file or directory</a> for details on this exception.    </p>\n    </div>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=50168339\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"API Runtime Services FAQ"});